    body = charToRaw("{\n  \"results\" :\n    [\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Current Employee Names, Salaries, and Position Titles\",\n            \"id\" : \"xzkq-xp2w\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"This dataset is a listing of all active City of Chicago employees, complete with full names, departments, positions, employment status (part-time or full-time), frequency of hourly employee –where applicable—and annual salaries or hourly rate. Please note that \\\"active\\\" has a specific meaning for Human Resources purposes and will sometimes exclude employees on certain types of temporary leave. For hourly employees, the City is providing the hourly rate and frequency of hourly employees (40, 35, 20 and 10) to allow dataset users to estimate annual wages for hourly employees. Please note that annual wages will vary by employee, depending on number of hours worked and seasonal status. For information on the positions and related salaries detailed in the annual budgets, see https://www.cityofchicago.org/city/en/depts/obm.html\\n\\nData Disclosure Exemptions:\\nInformation disclosed in this dataset is subject to FOIA Exemption Act, 5 ILCS 140/7 (Link:https://www.ilga.gov/legislation/ilcs/documents/000501400K7.htm)\",\n            \"attribution\" : \"City of Chicago\",\n            \"attribution_link\" : \"http://www.chicago.gov\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-08-17T04:53:40.000Z\",\n            \"createdAt\" : \"2011-09-27T20:18:55.000Z\",\n            \"metadata_updated_at\" : \"2024-06-18T19:22:48.000Z\",\n            \"data_updated_at\" : \"2025-08-17T04:53:40.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 2174,\n                \"page_views_last_month\" : 10225,\n                \"page_views_total\" : 2133903,\n    