: [],\n            \"description\" : \"The rental housing developments listed below are among the thousands of affordable units that are supported by City of Chicago programs to maintain affordability in local neighborhoods. The list is updated periodically when construction is completed for new projects or when the compliance period for older projects expire, typically after 30 years. The list is provided as a courtesy to the public. It does not include every City-assisted affordable housing unit that may be available for rent, nor does it include the hundreds of thousands of naturally occurring affordable housing units located throughout Chicago without City subsidies. For information on rents, income requirements and availability for the projects listed, contact each property directly. For information on other affordable rental properties in Chicago and Illinois, call (877) 428-8844, or visit www.ILHousingSearch.org.\",\n            \"attribution\" : \"City of Chicago\",\n            \"attribution_link\" : \"http://www.cityofchicago.org\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2024-12-30T22:11:37.000Z\",\n            \"createdAt\" : \"2013-03-14T21:05:29.000Z\",\n            \"metadata_updated_at\" : \"2024-12-30T22:11:34.000Z\",\n            \"data_updated_at\" : \"2024-12-30T22:11:37.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 270,\n                \"page_views_last_month\" : 1083,\n                \"page_views_total\" : 557416,\n                \"page_views_last_week_log\" : 8.082149041353873,\n                \"page_views_last_month_log\" : 10.082149041353873,\n                \"page_views_total_log\" : 19.088397476594537\n              },\n            \"columns_name\" :\n              [\n                \"Units\",\n                \"Zip Code\",\n                \"Property Type\",\n                \"Zip Codes\",\n                \"Census