: \"interactive\",\n            \"display_name\" : \"cocadmin\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Business Licenses\",\n            \"id\" : \"r5kz-chrr\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"NOTE, 2/21/2025 - We have <a href=\\\"https://data.cityofchicago.org/stories/s/yu97-as3j\\\" target=\\\"_blank\\\">added</a> three geographic columns to this dataset.\\n\\nBusiness licenses issued by the Department of Business Affairs and Consumer Protection in the City of Chicago from 2002 to the present. This dataset contains a large number of records/rows of data and may not be viewed in full in Microsoft Excel. Therefore, when downloading the file, select CSV from the Export menu. Open the file in an ASCII text editor, such as Notepad or Wordpad, to view and search. \\n \\nData fields requiring description are detailed below. \\n\\nAPPLICATION TYPE:  ‘ISSUE’ is the record associated with the initial license application.  ‘RENEW’ is a subsequent renewal record.  All renewal records are created with a term start date and term expiration date.  ‘C_LOC’ is a change of location record.  It means the business moved.   ‘C_CAPA’ is a change of capacity record.  Only a few license types may file this type of application.  ‘C_EXPA’ only applies to businesses that have liquor licenses.  It means the business location expanded.  'C_SBA' is a change of business activity record. It means that a new business activity was added or an existing business activity was marked as expired.\\n\\nLICENSE STATUS: ‘AAI’ means the license was issued. ‘AAC’ means the license was cancelled during its term.  ‘REV’ means the license was revoked. 'REA' means the license revocation has been appealed.\\n\\nLICENSE STATUS CHANGE DATE:  This date corresponds to the date a license was cancelled (AAC), revoked (REV) or appealed (REA).\\n\\nBusiness License Owner information may be accessed at:  https://data.cityofchicago.org/dataset/Business-Owners/ezma-pppn. To identify the owner of a business, you will need the account number or legal name, which may be obtained from this Business Licenses dataset. \\n\\nData Owner: Business Affairs and Consumer Protection. Time Period: January 1, 2002 to present. Frequency: Data is updated daily.\",\n            \"attribution\" : \"City of Chicago\",\n            \"attribution_link\" : \"http://www.cityofchicago.org\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-08-16T09:57:55.000Z\",\n            \"createdAt\" : \"2011-09-27T16:03:34.000Z\",\n            \"metadata_updated_at\" : \"2025-02-21T21:42:37.000Z\",\n            \"data_updated_at\" : \"2025-08-16T09:57:55.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 965,\n                \"page_views_last_month\" : 3826,\n                \"page_views_total\" : 301438,\n                \"page_views_last_week_log\" : 9.915879378835774,\n                \"page_views_last_month_log\" : 11.901998185668495,\n                \"page_views_total_log\" : 18.201506558481586\n              },\n            \"columns_name\" :\n              [\n                \"APPLICATION REQUIREMENTS COMPLETE\",\n                \"PRECINCT\",\n                \"CONDITIONAL APPROVAL\",\n                \"COMMUNITY AREA\",\n                \"NEIGHBORHOOD\",\n                \"BUSINESS ACTIVITY\",\n                \"LICENSE STATUS\",\n                \"LOCATION (zip)\",\n                \"CITY\",\n                \"Community Areas\",\n                \"Historical Wards 2003-2015\",\n                \"Zip Codes\",\n                \"Census Tracts\",\n                \"Wards\",\n                \"LOCATION (state)\",\n                \"ZIP CODE\",\n                \"DOING BUSINESS AS NAME\",\n                \"POLICE DISTRICT\",\n                \"STATE\",\n                \"LICENSE APPROVED FOR ISSUANCE\",\n                \"LICENSE TERM START DATE\",\n                \"PAYMENT DATE\",\n                \"APPLICATION CREATED DATE\",\n                \"WARD\",\n                \"ACCOUNT NUMBER\",\n                \"ID\",\n                \"LOCATION\",\n                \"LEGAL NAME\",\n                \"LICENSE DESCRIPTION\",\n                \"COMMUNITY AREA NAME\",\n                \"WARD PRECINCT\",\n                \"ADDRESS\",\n                \"LOCATION (city)\",\n                \"LICENSE CODE\",\n                \"LICENSE ID\",\n                \"LICENSE NUMBER\",\n                \"LICENSE STATUS CHANGE DATE\",\n                \"BUSINESS ACTIVITY ID\",\n                \"LOCATION (address)\",\n                \"LONGITUDE\",\n                \"APPLICATION TYPE\",\n                \"DATE ISSUED\",\n                \"LATITUDE\",\n                \"LICENSE TERM EXPIRATION DATE\",\n                \"SITE NUMBER\",\n                \"SSA\"\n              ],\n            \"columns_field_name\" :\n              [\n                \"application_requirements_complete\",\n                \"precinct\",\n                \"conditional_approval\",\n                \"community_area\",\n                \"neighborhood\",\n                \"business_activity\",\n                \"license_status\",\n                \"location_zip\",\n                \"city\",\n                \":@computed_region_vrxf_vc4k\",\n                \":@computed_region_awaf_s7ux\",\n                \":@computed_region_6mkv_f3dw\",\n                \":@computed_region_bdys_3d7i\",\n                \":@computed_region_43wa_7qmu\",\n                \"location_state\",\n                \"zip_code\",\n                \"doing_business_as_name\",\n                \"police_district\",\n                \"state\",\n                \"license_approved_for_issuance\",\n                \"license_start_date\",\n                \"payment_date\",\n                \"application_created_date\",