 where the business is located. This column can be used to filter by precinct more easily across multiple wards. \",\n                \"\",\n                \"\",\n                \"A code for the type of license. Each code value corresponds to a specific LICENSE DESCRIPTION value.\",\n                \"An internal database ID for each record.  Each license can have multiple records as it goes through renewals and other transactions.  See the LICENSE NUMBER field for the number generally known to the public and used in most other data sources that refer to the license.\",\n                \"The license number known to the public and generally used in other data sources that refer to the license. This is the field most users will want for most purposes. Each license has a single license number that stays consistent throughout the lifetime of the license. By contrast, the LICENSE ID field is an internal database ID and not generally useful to external users.\",\n                \"\",\n                \"A code for the business activity. Each ID value corresponds to a specific BUSINESS ACTIVITY value.\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"An internal database ID indicating the location of this licensed business to account for business owners with more than one location.\",\n                \"Special Service Areas  are local tax districts that fund expanded services and programs, to foster commercial and economic development, through a localized property tax. In other cities these areas are sometimes called Business Improvement Districts (BIDs). This portal contains a map of all Chicago SSAs\"\n              ],\n            \"columns_format\" :\n              [\n                { \"view\" : \"date\", \"align\" : \"left\" },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"true\",\n           